script: |
  super -f text -I q12651.spq | sort > q12651.out

inputs:
  - name: q12651.spq
    data: |
      SELECT DISTINCT col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 53 + col1 - - - ( + col1 ) + col2 * + col1 / - - col0 * col2 + - 32 > NULL;
  - name: tab2

outputs:
  - name: q12651.out
    data: |
